pragma solidity 0.4.24;

import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC20/SafeERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC721/ERC721.sol";
import "./Types.sol";


library Receive {
  using SafeMath for uint256;
  using SafeERC20 for ERC20;

  // send ether amount to receiver
  function ethereum(Types.Item storage self) private {}

  // send erc20 token amount to receiver
  function erc20(Types.Item storage self) private {
    return ERC20(self.contractAddr).safeTransferFrom(self.owner, this, self.idOrAmount);
  }

  // send erc721 tokenId to receiver
  function erc721(Types.Item storage self) private {
    return ERC721(self.contractAddr).safeTransferFrom(self.owner, this, self.idOrAmount);
  }

  function receive(Types.Item storage self) internal {
    if (self.currencyType == Types.CurrencyType.ETHEREUM) return ethereum(self);
    else if (self.currencyType == Types.CurrencyType.ERC20) return erc20(self);
    else if (self.currencyType == Types.CurrencyType.ERC721) return erc721(self);

    revert();
  }
}
